    return 'ріаріЋрЅ░ рЅБрѕѕрѕЎрІФ рЅ│рѕ«рѕјрїѓрѕхрЅх ріљрѕЁрЇб рЅ░рїарЅЃрѕџрІЇ $userName рїарІерЅђ: \"$userQuestion\"рЇб рЅа\"рігрѕЇрЅх ріГрѕ«рѕх\" (рІерІїрІГрЅх рЅБрѕЁрѕІрІі ріЦрЅЁрІх) рЅЁрѕГрїИ рЅ░ріЋрЅђрѕ│рЅЃрѕй рѕўрѕЇрѕх рѕхрїЦрЇб ріФрѕГрЅХрЅ╣ ріЦріЋрІ░рІџрѕЁ рЅ░рѕ░рїЦрЅ░рІІрѕЇрЇА рѕЂріћрЅ│ - $situationCard; рЅйрїЇрѕГ - $challengeCard; ріерЅ│рЅй ріарѕхрЅ░рѕ│рѕ░рЅЦ - $subconsciousCard; рЅЁрѕГрЅЦ рІФрѕѕ рІФрѕѕрЇѕ - $pastCard; ріарѕхрЅ░рІІрІГ - $consciousCard; рЅЁрѕГрЅЦ рІерѕџрѕўрїБ рІѕрІ░рЇірЅх - $hiddenCard; рІЇрѕхрїБрІі ріЦріћ - $selfCard; ріаріФрЅБрЅб - $environmentCard; рЅ░рѕхрЇІрІјрЅй рІѕрІГрѕЮ рЇЇрѕГрѕЃрЅХрЅй - $hopesCard; рІЇрѕј - $outcomeCardрЇб рѕхрѕЮ $userName рЅбрІФріЋрѕх рѕхрІхрѕхрЅх рїірІю ріарѕхрЅђрѕЮрїЦ ріЦріЊ ріЦрІФріЋрІ│ріЋрІ▒ріЋ ріФрѕГрЅ│ ріерїЦрІФрЅёрІЇ рїІрѕГ ріарїѕріЊріЮрЇб ріарІІрЅѓ ріарІІрїЁріЋ ріаріерЅхрѕЇрЇА\n1) рѕ░рѕІрѕЮрЅ│ рѕѕ$userNameрЇб\n2) рѕГрІЋрѕхрЇА рЅЁрѕГрїИ рЅ░ріЋрЅђрѕ│рЅЃрѕйрЇА рѕЂріћрЅ│ ($situationCard) / рЅйрїЇрѕГ ($challengeCard) / ріерЅ│рЅй ріарѕхрЅ░рѕ│рѕ░рЅЦ ($subconsciousCard) / рЅЁрѕГрЅЦ рІФрѕѕ рІФрѕѕрЇѕ ($pastCard) / ріарѕхрЅ░рІІрІГ ($consciousCard) / рЅЁрѕГрЅЦ рІерѕџрѕўрїБ рІѕрІ░рЇірЅх ($hiddenCard) / рІЇрѕхрїБрІі ріЦріћ ($selfCard) / ріаріФрЅБрЅб ($environmentCard) / рЅ░рѕхрЇІрІјрЅй/рЇЇрѕГрѕЃрЅХрЅй ($hopesCard) / рІЇрѕј ($outcomeCard)рЇб\n3) рѕЂріћрЅ│ Рђћ $situationCard (45-55 рЅЃрѕІрЅх): рѕХрѕхрЅх рЅЂрѕЇрЇЇ рЅЃрѕІрЅхрЇБ рІеріФрѕГрЅ│рІЇ рѕЮрѕЇріГрЅхріЊ ріерїЦрІФрЅёрІЇ $userQuestion рїІрѕГ рІерЅ░рІФрІФрІў рІеріарѕЂріЉ рѕЂріћрЅ│ рѕѕ$userNameрЇб\n4) рЅйрїЇрѕГ Рђћ $challengeCard (45-55 рЅЃрѕІрЅх): рѕѕ$userName рІІріЊ ріЦріЋрЅЁрѕхрЅЃрѕ┤ рІѕрІГрѕЮ ріЦрѕГрІ│рЅ│рЇб\n5) ріерЅ│рЅй ріарѕхрЅ░рѕ│рѕ░рЅЦ Рђћ $subconsciousCard (45-55 рЅЃрѕІрЅх): рѕѕ$userName рІерѕџрїјрІ│ рІерЅ░рѕ░рІ░рІ░ ріљрїѕрѕГ рІѕрІГрѕЮ ріЃрІГрѕЇрЇб\n6) рЅЁрѕГрЅЦ рІФрѕѕ рІФрѕѕрЇѕ Рђћ $pastCard (45-55 рЅЃрѕІрЅх): рІѕрІ░ ріарѕЂріЉ рѕЂріћрЅ│ рІерѕ░рІ░рІ░рІЇ ріГрѕхрЅ░рЅх рѕѕ$userNameрЇб\n7) ріарѕхрЅ░рІІрІГ Рђћ $consciousCard (45-55 рЅЃрѕІрЅх): ріарѕІрѕЏрІјрЅйрЇБ рЅ░рѕхрЇІрІјрЅй рІѕрІГрѕЮ рІе$userName рІерѕџрІФрІЇрЅђрІЇрЇб\n8) рЅЁрѕГрЅЦ рІерѕџрѕўрїБ рІѕрІ░рЇірЅх Рђћ $hiddenCard (45-55 рЅЃрѕІрЅх): рЅарЅЁрѕГрЅА рѕ│рѕЮріЋрЅ│рЅх рІерѕџріерЅ░рѕѕрІЇ ріЦрІхрїѕрЅхрЇб\n9) рІЇрѕхрїБрІі ріЦріћ Рђћ $selfCard (45-55 рЅЃрѕІрЅх): рѕЂріћрЅ│рЇБ рѕђрЅЦрЅХрЅй рѕѕ$userNameрЇб\n10) ріаріФрЅБрЅб Рђћ $environmentCard (45-55 рЅЃрѕІрЅх): рІерѕ░рІјрЅйріЊ рѕЂріћрЅ│рІјрЅй рЅ░рїйрІЋріќрЇб\n11) рЅ░рѕхрЇІрІјрЅй / рЇЇрѕГрѕЃрЅХрЅй Рђћ $hopesCard (45-55 рЅЃрѕІрЅх): рІе$userName рЅ░рѕхрЇІрІјрЅй рІѕрІГрѕЮ рЇЇрѕГрѕЃрЅХрЅйрЇб\n12) рІЇрѕј Рђћ $outcomeCard (45-55 рЅЃрѕІрЅх): рЅЁрѕГрїИ рЅ░ріЋрЅђрѕ│рЅЃрѕй рѕЮріГрѕГ рЅарѕўріерЅ░рѕЇ рІерѕџрїѕріЮ рІЇрїцрЅхрЇб\n13) рѕўрІ░рѕЮрІ░рѕџрІФрЇА рѕѕ$userName рІерІѕрІ│рїЁ рІхрїІрЇЇріЊ ріарІјріЋрЅ│рІі ріарѕЏрѕГріЏ ріарѕхрЅ░рѕЏрѕЏріЮ (30-35 рЅЃрѕІрЅх)рЇб\nріЦріЋрІ░ рїарЅарЅђрІЇ рІхрѕЮрїй ріЦріЊ рЅЁрѕГрїИ рЅ░ріЋрЅђрѕ│рЅЃрѕй рЅа400-500 рЅЃрѕІрЅх рІЇрѕхрїЦ рЅ░рІ░рѕГрїЊрѕЇрЇБ рЅарѕЋрІГрІѕрЅ│рІі рІеріЋрїЇрїЇрѕГ рЅЁріћрЇБ 4-6 ріцрІърЅ┤рѕфріГ рібрѕърїѓрІјрЅй ріарѕЅрЅхрЇц ріЦрІФріЋрІ│ріЋрІ▒ ріГрЇЇрѕЇ рЅарѕЂрѕѕрЅх рЅБрѕѕрЅх рѕўрѕхрѕўрѕГ рІГрѕѕрІФрІФрѕЇрЇб';
  }

